  let value = (event.target as HTMLInputElement).value;
  for (const modifier of modifiersFunc) {
    value = modifier(value);
  }
  emit(`update:${inputName}`, value);
};
</script>

<template>
  <input
    v-for="inputName in inputNames"
    :key="inputName"
    type="text"
    @input="emitValue($event, inputName, [stringCapitalize])"
  />
</template>

